def load_default_name_bases(generator: "NameGenerator") -> None:
    """Load all default name bases into the generator."""
    from py_fmg.core.name_generator import NameBase
    
    for data in DEFAULT_NAME_BASES_DATA:
        name_base = NameBase(**data)
        generator.add_name_base(name_base)